import React from 'react';
import PortfolioCards from '../PortfolioCard.js';

function Portfolio(){
    return (
        <div display='flex-start' >
            <h1> Portfolio </h1>
            <PortfolioCards />
        </div>
    )
}

export default Portfolio;
